import {Routes, Route, BrowserRouter} from "react-router-dom";
import Home from "./pages/home";
import Login from "./pages/login";
import Header from "./assets/header";
import ControlledCarousel from "./assets/carousel";
import '../src/styles/App.css';



function App() {
  return (
    <div className="page-container">
      {/* Header taking 20% of the height */}
      <header className="page-header">
        <h1>My Header</h1>
      </header>

      {/* Carousel taking the remaining 80% of the height */}
      <div id="carouselExample" className="carousel slide h-100" data-ride="carousel">
        <div className="carousel-inner h-100">
          <div className="carousel-item active h-100">
            <img src="https://via.placeholder.com/1200x800" className="d-block w-100 h-100" alt="Slide 1" />
          </div>
          <div className="carousel-item h-100">
            <img src="https://via.placeholder.com/1200x800" className="d-block w-100 h-100" alt="Slide 2" />
          </div>
          <div className="carousel-item h-100">
            <img src="https://via.placeholder.com/1200x800" className="d-block w-100 h-100" alt="Slide 3" />
          </div>
        </div>

        <a className="carousel-control-prev" href="#carouselExample" role="button" data-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="sr-only">Previous</span>
        </a>

        <a className="carousel-control-next" href="#carouselExample" role="button" data-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="sr-only">Next</span>
        </a>
      </div>
    </div>
  );
}




export default App;
